import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowRight } from '@fortawesome/free-solid-svg-icons'

const Container = styled.div`
    padding: 0 4em;
    padding-bottom: 3em;

    h2{
        font-size: 4.4em;
        font-family: Ruberoid;
        letter-spacing: .2px;
        line-height: 1em;
        margin: 0;
        padding: 0;
    }
`

function Landing5() {
  return (
    <Container>
        <h2>Blog</h2>
        <div>
            <div>
                <img src={LazyBridging}/>
                <p>BLOG</p>
                <h3>
                    Lazybridging: the Celestia endgame to solve 
                    fragmentation and stream assets from anywhere
                </h3>
                <p>Read now</p>
            </div>
            <div></div>
        </div>
    </Container>
  )
}

export default Landing5
